import { Link } from "react-router-dom";

export default function Navbar() {
  return (
   <nav className="tw-bg-white tw-shadow-md tw-py-4 tw-px-8 tw-flex tw-justify-between tw-items-center">
  <h1 className="tw-text-2xl tw-font-bold tw-text-gray-800">GenVision</h1>
  <div className="tw-flex tw-gap-6 tw-font-semibold">
    <a href="/" className="tw-text-blue-600 hover:tw-text-blue-800">Events</a>
    <a href="/participants" className="tw-text-blue-600 hover:tw-text-blue-800">Participants</a>
    <a href="/coordinators" className="tw-text-blue-600 hover:tw-text-blue-800">Coordinators</a>
    <a href="/guests" className="tw-text-blue-600 hover:tw-text-blue-800">Guests</a>
  </div>
</nav>
  );
}
